// to insure quick load time for website, determining name lists here then
// outputting them as arrays to browser to copy and paste into the website's js
const container = document.querySelector('#container')
const showInBrowser = (theArray, startString) => {
  const startH3 = document.createElement('h3')
  const startText = document.createTextNode(startString)
  startH3.appendChild(startText)
  startH3.className = 'start'
  container.appendChild(startH3)
  // preformatted text tag necessary to include spaces at beginning
  const preTag = document.createElement('pre')
  const spaces = document.createTextNode('  ')
  preTag.appendChild(spaces)
  let item
  // Can't make div inline so it has to be a paragraph
  const paragraph = document.createElement('p')
  for (let i = 0; i < theArray.length - 1; i++) {
    const itemListed = theArray[i]
    item = "'" + itemListed + "'," + ' '
    const listName = document.createTextNode(item)
    paragraph.appendChild(listName)
  }
  const lastListed = theArray[theArray.length - 1]
  const lastItem = "'" + lastListed + "'"
  const listEnd = document.createTextNode(lastItem)
  paragraph.appendChild(listEnd)
  preTag.appendChild(paragraph)
  container.appendChild(preTag)
  const endH3 = document.createElement('h3')
  // 2 options for endsWith, with or without length:
  const endWith = document.createTextNode('] // ' + theArray.length)
  // const endWith = document.createTextNode(']')
  endH3.appendChild(endWith)
  endH3.className = 'end'
  container.appendChild(endH3)
}

// insures items are only added once - no duplicates
const addToArray = (theArray, item) => {
  if (theArray.includes(item) === false) {
    theArray.push(item)
  }
}

