// number of syllables..........................................................
let sylCount
const allVowels = [
  'A', 'E', 'I', 'O', 'U', 'Y', 'a', 'e', 'i', 'o', 'u', 'y'
]
const add1forEachVowel = (name) => {
  // count each vowel as 1 syllable
  sylCount = 0
  for (let i = 0; i < name.length; i++) {
    const letter = name.charAt(i)
    for (let i = 0; i < allVowels.length; i++) {
      const vowel = allVowels[i]
      if (letter === vowel) {
        sylCount = sylCount + 1
      }
    }
  }
}

const subtract1ifVowelNotSyl = (name) => {
  // subtract for double vowels except ao eo eu ia ie io oa oe uo ya ye yi yo yu
  // ye part of aye, awy, eye, or has silent e
  const nameIncludes = [
    'Aa', 'Ai', 'Au', 'Ay', 'Ea', 'Oa', 'Ya', 'Ye', 'Yo', 'Yu', 'aa', 'ae',
    'ai', 'au', 'ay', 'awy', 'ea', 'ee', 'ei', 'Georg', 'Reu', 'ey', 'iya',
    'Daniel', 'iu', 'Sloan', 'oi', 'oo', 'ou', 'oy', 'ua', 'ue', 'ui', 'uy'
  ]
  for (let i = 0; i < nameIncludes.length; i++) {
    if (name.includes(nameIncludes[i])) {
      sylCount = sylCount - 1
    }
  }
  // subtract from sylCount for exceptions
  const exceptions1 = [
    'Charles', 'Hayes', 'James', 'Miles', 'Myles', 'Pierce', // 1syl name
    'Graham', // aha 1syl, 2syl in Abraham
    'Joan', 'Joaquin', // oa 1syl, 2syl in Joanna
    'Anya', 'Arya', // ya 1syl
    'Genevieve', 'Gracelyn', 'Rosemary', // internal silent e
    'Joel', 'Phoenix', // oe 1syl, Joe Monroe & Phoebe end in e
    'Yisroel'
  ]
  for (let i = 0; i < exceptions1.length; i++) {
    if (name === exceptions1[i]) {
      sylCount = sylCount - 1
    }
  }
}
const subtract1forSilentE = (name) => {
  // subtract from sylCount for silent e
  const end1 = name.charAt(name.length - 1)
  const end2 = name.charAt(name.length - 2)
  const last2 = end2 + end1
  // already subtracted 1 for ee and ue in subtract1ifVowelNotSyl function
  // ie is usually 2 syllables but at the end ie has a silent e
  if (end1 === 'e' && last2 !== 'ee' && last2 !== 'ue') {
    sylCount = sylCount - 1
  }
}
const add1forExceptions = (name) => {
  const exceptions2 = [
    // 2syl ae ai au ea oe ua ue ui
    'Nevaeh', 'Chaim', 'Raul', 'Aleah', 'Beatrice', 'Deandre', 'Deangelo',
    'Keanu', 'Lea', 'Leah', 'Maleah', 'Rhea', 'Thea', 'Chloe', 'Coen', 'Joey',
    'Khloe', 'Noe', 'Noel', 'Zoe', 'Joshua', 'Emmanuel', 'Immanuel', 'Luella',
    'Samuel', 'Luis', 'Luisa', 'Louie', 'Louis', 'Louise',
    // e not silent
    'Andre', 'Dante', 'Jesse', 'Jorge', 'Jose', 'Daphne', 'Dulce', 'Esme',
    'Halle', 'Penelope', 'Zoie',
    // B is a syllable
    'Bjorn'
  ]
  for (let i = 0; i < exceptions2.length; i++) {
    if (name === exceptions2[i]) {
      sylCount = sylCount + 1
    }
  }
  if (name.includes('Mc')) {
    // McKenzie Mckenna Mckinley
    sylCount = sylCount + 1
  }
}

