const combineNames = (yearA, yearB, combinedArray) => {
  const lengthA = yearA.length
  const lengthB = yearB.length
  let year1
  let year2
  if (lengthA < lengthB) {
    year1 = yearA
    year2 = yearB
  } else {
    year1 = yearB
    year2 = yearA
  }
  // alternate between lists when adding names since lists are ordered by rank
  for (let i = 0; i < year1.length; i++) {
    const name1 = year1[i]
    addToArray(combinedArray, name1)
    const name2 = year2[i]
    addToArray(combinedArray, name2)
  }
  // get the rest of the names in the longer array
  // can go through all of them since addToArray doesn't allow duplicates
  year2.forEach(name => {
    addToArray(combinedArray, name)
  })
}

